import React, { ReactElement } from "react";
import { TouchableOpacity } from "react-native";
import styled from "styled-components/native";
import { View, H1, TextInput, Text } from "../../styles";

const RoomDiv = styled(View)`
  flex: 1;
`;

const RoomBottom = styled(View)`
  height: 60px;
  background-color: #333;
`;

const RoomTop = styled(View)`
  height: 60px;
  background-color: #333;
`;

const RoomChat = styled(View)`
  background-color: #222;
  flex: 1;
`;

const RoomInput = styled(TextInput)`
  height: 100%;
  font-size: 1.5rem;
  padding: 5px;
`;

interface Props {}

export default function Room({}: Props): ReactElement {
  return (
    <RoomDiv>
      <RoomTop></RoomTop>

      <RoomChat></RoomChat>

      <RoomBottom>
        <RoomInput placeholder="Type a message" />
      </RoomBottom>
    </RoomDiv>
  );
}
